[{'comment_id': 817883669, 'comment_body': 'Any reason not to use `channelId` instead of `window.CHANNEL_EDIT_GLOBAL.channel_id` here?', 'comment_created': datetime.datetime(2022, 3, 2, 16, 39, 49, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 817889136, 'comment_body': ':eyes: ', 'comment_created': datetime.datetime(2022, 3, 2, 16, 45, 22, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 817894081, 'comment_body': 'Is this return value used?', 'comment_created': datetime.datetime(2022, 3, 2, 16, 50, 5, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 817906107, 'comment_body': 'Perhaps we should add some indices on channel and user?', 'comment_created': datetime.datetime(2022, 3, 2, 17, 2, 41, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 832395864, 'comment_body': 'No - I think this was a result of copy paste from elsewhere.', 'comment_created': datetime.datetime(2022, 3, 22, 16, 42, 1, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 832397096, 'comment_body': 'Nope!', 'comment_created': datetime.datetime(2022, 3, 22, 16, 43, 11, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 832397380, 'comment_body': 'That would seem eminently sensible. Will add them in a follow up migration with concurrent creation.', 'comment_created': datetime.datetime(2022, 3, 22, 16, 43, 28, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 858922436, 'comment_body': 'Does this require any special migrations? Or is it totally automatic', 'comment_created': datetime.datetime(2022, 4, 26, 16, 25, 55, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 858925385, 'comment_body': "I don't think it's critical, but seems like this could be connected with whether we're actually syncing? Like we have `stopSyncing()` for instance. Just wondering if there's any good reason why we should eventually stop this.", 'comment_created': datetime.datetime(2022, 4, 26, 16, 29, 4, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 858962289, 'comment_body': 'This error message leaves me...', 'comment_created': datetime.datetime(2022, 4, 26, 17, 11, 39, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 858976455, 'comment_body': "Shoudl this be `self.kwargs.copy()`? Otherwise, what's the reasoning I'm missing for a separate variable?", 'comment_created': datetime.datetime(2022, 4, 26, 17, 28, 26, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 858994699, 'comment_body': 'Should this be 
```js
get(user, `${MAX_REV_KEY}.${channelId}`, 0)
```
???', 'comment_created': datetime.datetime(2022, 4, 26, 17, 50, 6, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 859006524, 'comment_body': 'This is the same, the lodash `get` function allows you to specify the dot path either as a dot path or an array.', 'comment_created': datetime.datetime(2022, 4, 26, 18, 4, 43, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 859006932, 'comment_body': "I think I just did it to not write out `self.kwargs` over and over again, but I'll double check if there's a risk of mutation.", 'comment_created': datetime.datetime(2022, 4, 26, 18, 5, 17, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 859007034, 'comment_body': 'Wanting more?', 'comment_created': datetime.datetime(2022, 4, 26, 18, 5, 24, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 859007810, 'comment_body': "Yeah, we wouldn't need to continue doing these checks if we're not online for example - but it might be more complexity than it's worth to monitor it.", 'comment_created': datetime.datetime(2022, 4, 26, 18, 6, 23, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 859008395, 'comment_body': 'Dexie should handle this migration automatically - also possible that I could just leave it at `2`, as I think I only had to bump it to `3` because I had made two changes locally.', 'comment_created': datetime.datetime(2022, 4, 26, 18, 7, 6, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 859011822, 'comment_body': "But doesn't the dot path lookup follow nesting so the structure would have to be `{[MAX_REV_KEY]: { [channelId]: ... } }`? The key I see you setting is flat, not nested", 'comment_created': datetime.datetime(2022, 4, 26, 18, 10, 38, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 859012833, 'comment_body': "I guess my suggestion probably wouldn't work either with lodash `get`
", 'comment_created': datetime.datetime(2022, 4, 26, 18, 11, 56, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 859033140, 'comment_body': 'Ah, right - possible that I did not set this properly, will revist!', 'comment_created': datetime.datetime(2022, 4, 26, 18, 38, 28, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 860984451, 'comment_body': "Sorry, I was not thinking straight when I responded here - Dexie's update functions take key paths: https://dexie.org/docs/Table/Table.update() - so it is producing a nested change in spite of the key being a key path.", 'comment_created': datetime.datetime(2022, 4, 28, 14, 48, 19, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 860988086, 'comment_body': 'Have made some updates to at least sleep on blur.', 'comment_created': datetime.datetime(2022, 4, 28, 14, 50, 56, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 860990941, 'comment_body': "Oh! That's good to know that Dexie is unfurling that during the updates. I know there are a few places where you're using that dot notation for partial updates, but perhaps some comments could clarify it's taking advantage of that feature?", 'comment_created': datetime.datetime(2022, 4, 28, 14, 53, 14, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 861012119, 'comment_body': 'Yes, should be a copy - as otherwise we are modifying a property of the model in place!', 'comment_created': datetime.datetime(2022, 4, 28, 15, 12, 14, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 869539638, 'comment_body': "It looks like this approach will be okay for copying, but it doesn't look like it will work for publishing and may confuse devs in the future if we carry on using this pattern. The reason is that if the task requires a database transaction, then these writes for progress could be contained within the transaction and won't be readable outside of the transaction until it is committed, obviously. Looking at `map_content_nodes` that is called during publishing, it seems that it would run into this problem.

For this reason, in my task-related WIP, I utilized the task events to broadcast progress to a listener that could read and write outside of any database transactions occurring within the task.", 'comment_created': datetime.datetime(2022, 5, 10, 18, 4, 25, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 892520232, 'comment_body': 'Seems this could be simplified slightly. How about this?
```js
  const idsToCheck = {
    [TABLE_NAMES.CONTENTNODE]: contentNodeIds,
    [TABLE_NAMES.FILE]: fileIds,
    [TABLE_NAMES.ASSESSMENTITEM]: assessmentIds,
  };
  const query = await db[CHANGES_TABLE].toCollection()
    .filter(c => !c.synced)
    .toArray();
  for (let change of query) {
    if (idsToCheck[change.table] && idsToCheck[change.table].includes(change.key)) {
      return true;
    }
  }
  return false;
```', 'comment_created': datetime.datetime(2022, 6, 8, 15, 18, 5, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 892524496, 'comment_body': 'Should this promise also wait for the bookmarks to load, serially or simultaneously?', 'comment_created': datetime.datetime(2022, 6, 8, 15, 21, 40, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 892536379, 'comment_body': 'Maybe move the `.map(Number)` to the above `map` so `disallowed.map(d => Number(d.rev))`?', 'comment_created': datetime.datetime(2022, 6, 8, 15, 31, 44, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 892538116, 'comment_body': 'Does this need mapped to a `Number` too?', 'comment_created': datetime.datetime(2022, 6, 8, 15, 33, 22, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 892553833, 'comment_body': 'Usually we use camel case for variables, except for when we want it snake case for setting it on an object, i.e. `{ channel_ids }`. So my question here is if you had intended to do that somewhere and missed it, or if this is just a random casing thing?', 'comment_created': datetime.datetime(2022, 6, 8, 15, 46, 58, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 892555805, 'comment_body': 'Is this required?', 'comment_created': datetime.datetime(2022, 6, 8, 15, 48, 44, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 892559398, 'comment_body': 'Since `mapChannel` has a defensive check on `channel`, perhaps you can move this up to the previous `map`?', 'comment_created': datetime.datetime(2022, 6, 8, 15, 51, 59, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 892560495, 'comment_body': 'Since this no longer needs to `await`, does this need to be `async` anymore?', 'comment_created': datetime.datetime(2022, 6, 8, 15, 53, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 892565166, 'comment_body': 'This looks suspicious', 'comment_created': datetime.datetime(2022, 6, 8, 15, 57, 18, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 892681631, 'comment_body': 'Does this need to be ordered?', 'comment_created': datetime.datetime(2022, 6, 8, 17, 40, 57, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 892895624, 'comment_body': 'Yes, probably safest to do so.', 'comment_created': datetime.datetime(2022, 6, 8, 21, 50, 32, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 892897642, 'comment_body': 'Yes, not quite sure why I mapped twice there...', 'comment_created': datetime.datetime(2022, 6, 8, 21, 54, 8, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 892899115, 'comment_body': 'No, this should be ok, although I am now confused why I need the `Number` coersion at all - as both the `rev` and `server_rev` are stored on the server as Integers - so not sure why it needed to be coerced here.', 'comment_created': datetime.datetime(2022, 6, 8, 21, 56, 50, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 892899863, 'comment_body': "Originally I was just sending `channel_ids` directly to the server, and that's why it was snake case. Now that it's being sent via `channel_revs` it's not needed. I'll update to camelCase to remove the confusion.", 'comment_created': datetime.datetime(2022, 6, 8, 21, 58, 9, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 892900827, 'comment_body': 'I think I should probably just move the await above out of the if statement - the information from it is needed to correctly annotate bookmarks on the loaded channels.', 'comment_created': datetime.datetime(2022, 6, 8, 21, 59, 57, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 892902599, 'comment_body': "Hrm, I suspect that not being await was a mistake - I'll revert that.", 'comment_created': datetime.datetime(2022, 6, 8, 22, 3, 12, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 892903104, 'comment_body': 'Flagging that we chatted about this, and resolved to clear in follow up work.', 'comment_created': datetime.datetime(2022, 6, 8, 22, 4, 6, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 892903630, 'comment_body': "I think I've found something even more concise!", 'comment_created': datetime.datetime(2022, 6, 8, 22, 5, 8, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 892904582, 'comment_body': 'Possibly - I added an explicit order_by `server_rev` to be safe.', 'comment_created': datetime.datetime(2022, 6, 8, 22, 7, 5, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}]

[{'comment_id': 895905152, 'comment_body': 'This structure of `threshold` and `model` are new, so having those directly underneath `options` doesn't currently exist. What's your intent here-- to emulate the old/existing structure?

The old/existing structure should be:
```python
        metadata["extra_fields"] = {
            "options": {
                "m": 3,
                "n": 6,
                "mastery_model": exercises.M_OF_N,
            }
        }
```

Since you added your ` consolidate_extra_fields` to `field_map`, which is invoked during serialization of a content node, a good test would be to ensure that serializing a content node with the old mastery structure, like in a GET request, produces the new structure.', 'comment_created': datetime.datetime(2022, 6, 13, 16, 16, 8, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 899110972, 'comment_body': "Looks like there's an extraneous `print` here!", 'comment_created': datetime.datetime(2022, 6, 16, 13, 55, 23, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 899114051, 'comment_body': 'What spurred changes to this class? Are they still required?', 'comment_created': datetime.datetime(2022, 6, 16, 13, 57, 58, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}, {'comment_id': 899148315, 'comment_body': 'I was getting "errors":{"extra_fields":{"options":{"completion_criteria":{"threshold":["Not a valid string."]}}}}}]}' when I was running the tests. It seems like we need to add special handling in the to_internal_value function. This was the work around suggested by @rtibbles sir.', 'comment_created': datetime.datetime(2022, 6, 16, 14, 28, 34, tzinfo=datetime.timezone.utc), 'commenter': 'ozer550', 'type': 'User'}, {'comment_id': 899159618, 'comment_body': 'Yeah - the issue here was that the ThresholdField needs to allow either a string, integer, dict, or null - but the CharField with some extra validation only allowed string, integer or null.', 'comment_created': datetime.datetime(2022, 6, 16, 14, 39, 23, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 899190061, 'comment_body': "Would be good to add an extra condition here checking `mastery_model is not None` - and add an extra test for this condition - basically, when the exercise hasn't had a mastery model set on it.", 'comment_created': datetime.datetime(2022, 6, 16, 15, 8, 7, tzinfo=datetime.timezone.utc), 'commenter': 'rtibbles', 'type': 'User'}, {'comment_id': 899348987, 'comment_body': "I made a mistake here. The old format was at the top level of `extra_fields`, not `extra_fields.options`. So in your tests, the old data should be moved up a level, and a change to your consolidate function to match. I got hung up on the existence of `threshold` that you had previously, I missed that the old format wasn't inside `options`. My apologies!", 'comment_created': datetime.datetime(2022, 6, 16, 17, 22, 33, tzinfo=datetime.timezone.utc), 'commenter': 'bjester', 'type': 'User'}]
